var tipuesearch = {"pages":[{"title":"Changelog","text":"  All notable changes to this project will be documented in this file.  The format is based on Keep a Changelog, and this project adheres to Semantic Versioning.  [Unreleased]   lorem   [N.N.N] - YYYY-MM-DD  Added   lorem   Changed   lorem   Deprecated   lorem   Removed   lorem   Fixed   lorem   Security   lorem  ","tags":"","url":"CHANGELOG.html"},{"title":"Website Benchmark","text":"    Summary  Generate benchmark reports based on page-load times for your website.  Visit https:\/\/aklump.github.io\/website_benchmark for full documentation.  Quick Start   Install in your repository root using cloudy pm-install aklump\/website_benchmark Open bin\/config\/website_benchmark.yml and modify as needed. Measure your site using .\/bin\/website_benchmark measure --note=\"Before upgrade to PHP 7\" You will see your results printed as JSON to the console. Results are also saved to results_dir, if that's been set and created.   Requirements  You must have Cloudy installed on your system to install this package.  Installation  The installation script above will generate the following structure where . is your repository root.  . \u251c\u2500\u2500 bin \u2502\u00a0\u00a0 \u251c\u2500\u2500 website_benchmark -&gt; ..\/opt\/website_benchmark\/website_benchmark.sh \u2502\u00a0\u00a0 \u2514\u2500\u2500 config \u2502\u00a0\u00a0     \u2514\u2500\u2500 website_benchmark.yml \u251c\u2500\u2500 opt \u2502   \u251c\u2500\u2500 cloudy \u2502   \u2514\u2500\u2500 aklump \u2502       \u2514\u2500\u2500 website_benchmark \u2514\u2500\u2500 {public web root}   To Update   Update to the latest version from your repo root: cloudy pm-update aklump\/website_benchmark   Configuration Files  Refer to the files for documentation about configuration options.       Filename   Description   VCS       website_benchmark.yml   Configuration for the script.   yes     Usage   To see all commands use .\/bin\/website_benchmark   Contributing  If you find this project useful... please consider making a donation. ","tags":"","url":"README.html"},{"title":"Search Results","text":" ","tags":"","url":"search--results.html"}]};
